import React from 'react';
import {Grid, Row, Col, Container} from 'react-bootstrap';
import './sidebar.css';
//import '../../custom.scss';

function Example() {
  return (
        <Container fluid>
            <Row className='base'>
                <Col xs={1}>
                Bava
                </Col>
                <Col>
                Bava
                </Col>
            </Row>
            
        </Container>
    )
}

export default Example;
